import React from "react";
import { Navbar, NavbarText } from "reactstrap";

const Footer = () => {
  return (
    <div>
      <Navbar
        className=""
        color="dark"
        dark="true"
        full="true"
        container="fluid"
        fixed="bottom"
      >
        <NavbarText>Corey Cass</NavbarText>
      </Navbar>
    </div>
  );
};

export default Footer;
